import "./App.css";
// import Wrapper from "./components/Wrapper";
import Wrapper from "./components/Wrapper";
import WrapperBack from "./components/WrapperBack";
import ReactCardFlip from 'react-card-flip';

const App = () => {
  return (
    <div className="App">
      <ReactCardFlip
        isFlipped={this.state.isFlipped}
        flipDirection="horizontal"
      >
        <Wrapper />
        <WrapperBack />
      </ReactCardFlip>
    </div>
  );
};

export default App;
